Dynamically Populating a Field with $addFields When Getting Document By Id<p>I would like to use <code>$aggregate</code> and the <code>$addFields</code> to dynamically populate a field when I run a getById() function in my MongoDB collection. Basically what I want to do is pull out the last element in an array of objects from a property called "history", and dynamically populate that to a field titled "activeStatus", which is an object. So this particular block of code looks like this:</p>

<pre><code>await db.collection("staffmembers").aggregate([{ $addFields: { activeStatus: { $arrayElemAt: ["$history", -1.0] } } }, { $out: "staffmembers" }]);
</code></pre>

<p>This is what the full getById() function looks like:</p>

<pre><code>exports.getById = async function(req, res) {
  let doc;
  let MongoClient = await require("../config/database")();
  let db = MongoClient.connection.db;

  let request = new EndpointRequestController(
    req,
    res,
    // Allowed Parameters
    {
      id: {
        type: String
      }
    },
    [
      // Required Parameters
      "id"
    ]
  );

  await db.collection("staffmembers").aggregate([{ $addFields: { activeStatus: { $arrayElemAt: ["$history", -1.0] } } }, { $out: "staffmembers" }]);

  try {
    doc = await StaffMember.findOne(
      {
        _id: request.parameters.id
      },
      {}
    ).exec();
    if (doc) req.documentCount = 1;
  } catch (err) {
    return request.sendError("An error occurred while trying to find existing records.", err);
  }

  res.send(doc);
};
</code></pre>

<p>While I don't get any errors, I don't see "activeStatus" in the resulting document.</p>

<p>Is this something I can do in a situation like this? And, if so, what a I missing?</p>

<p>By the way, my document looks like this:</p>

<pre><code>{
    "_id": &lt;id value&gt;,
    "type": "permanent",
    "gender": "female",
    "history": [
        {
            "endDate": "2018-10-31T12:27:17.721Z",
            "stage": "training",
            "completed": true,
            "startDate": "2018-10-30T13:41:18.714Z"
        },
        {
            "stage": "active",
            "completed": false,
            "startDate": "2018-10-31T12:27:17.572Z"
        }
    ]
}
</code></pre>

<p>And this is the doc I want to produce:</p>

<pre><code>{
    "_id": &lt;id value&gt;,
    "type": "permanent",
    "gender": "female",
    "history": [
        {
            "endDate": "2018-10-31T12:27:17.721Z",
            "stage": "training",
            "completed": true,
            "startDate": "2018-10-30T13:41:18.714Z"
        },
        {
            "stage": "employed",
            "completed": false,
            "startDate": "2018-10-31T12:27:17.572Z"
        }
    ],
    "activeStatus": {
            "stage": "employed",
            "completed": false,
            "startDate": "2018-10-31T12:27:17.572Z"
    }
}
</code></pre>

