CodecConfigurationException when saving ZonedDateTime to MongoDB with Spring Boot >= 2.0.1.RELEASE<p>I was able to reproduce my problem with a minimal modification of the official Spring Boot guide for <a href="https://spring.io/guides/gs/accessing-data-mongodb/" rel="nofollow noreferrer">Accessing Data with MongoDB</a>, see <a href="https://github.com/thokrae/spring-data-mongo-zoneddatetime" rel="nofollow noreferrer">https://github.com/thokrae/spring-data-mongo-zoneddatetime</a>.</p>
<p>After adding a <code>java.time.ZonedDateTime</code> field to the Customer class, running the example code from the guide fails with a CodecConfigurationException:</p>
<p>Customer.java:</p>
<pre><code>public String lastName;
public ZonedDateTime created;

public Customer() {
</code></pre>
<p>output:</p>
<pre><code>...
Caused by: org.bson.codecs.configuration.CodecConfigurationException`: Can't find a codec for class java.time.ZonedDateTime.
at org.bson.codecs.configuration.CodecCache.getOrThrow(CodecCache.java:46) ~[bson-3.6.4.jar:na]
at org.bson.codecs.configuration.ProvidersCodecRegistry.get(ProvidersCodecRegistry.java:63) ~[bson-3.6.4.jar:na]
at org.bson.codecs.configuration.ChildCodecRegistry.get(ChildCodecRegistry.java:51) ~[bson-3.6.4.jar:na]
</code></pre>
<p>This can be solved by changing the Spring Boot version from 2.0.5.RELEASE to 2.0.1.RELEASE in the pom.xml:</p>
<pre><code>&lt;parent&gt;
    &lt;groupId&gt;org.springframework.boot&lt;/groupId&gt;
    &lt;artifactId&gt;spring-boot-starter-parent&lt;/artifactId&gt;
    &lt;version&gt;2.0.1.RELEASE&lt;/version&gt;
&lt;/parent&gt;
</code></pre>
<p>Now the exception is gone and the Customer objects including the ZonedDateTime fields <a href="https://github.com/thokrae/spring-data-mongo-zoneddatetime/blob/master/ZonedDateTime.png" rel="nofollow noreferrer">are written to MongoDB</a>.</p>
<p>I filed a bug (<a href="https://jira.spring.io/browse/DATAMONGO-2106" rel="nofollow noreferrer">DATAMONGO-2106</a>) with the spring-data-mongodb project but would understand if changing this behaviour is not wanted nor has a high priority.</p>
<p>What is the best workaround? When duckduckgoing for the exception message I find several approaches like registering a <a href="http://mongodb.github.io/mongo-java-driver/3.4/bson/codecs/" rel="nofollow noreferrer">custom codec</a>, a <a href="https://docs.spring.io/spring-data/mongodb/docs/2.0.10.RELEASE/reference/html/#mongo.custom-converters" rel="nofollow noreferrer">custom converter</a> or using <a href="https://www.mkyong.com/mongodb/spring-data-mongodb-jsr-310-or-java-8-new-date-apis/" rel="nofollow noreferrer">Jackson JSR 310</a>. I would prefer to not add custom code to my project to handle a class from the java.time package.</p>

