<p>Class:</p>

<pre><code>public class Address
{
    [BsonId]
    public ObjectId Id { get; set; }
    public long Building_Number { get; set; }
    public BsonDocument ExtraElements { get; set; }
}
</code></pre>

<p>Controller:</p>

<pre><code>[HttpGet("{number}")]
    public async Task&lt;IActionResult&gt; GetAddressByNumber(long number)
    {
        try
        {
            var address = _repository.GetAddressByNumber(number);

            if (address == null)
            {
                return new NotFoundResult();
            }

            return new ObjectResult(address);
        }
        catch(Exception ex)
        {
            return null;
        }

    }
</code></pre>

<p>When I run an API to the controller, all the additional elements are placed into the ExtraElements, as expected.</p>

<p>The problem occurs when ObjectResult sends the result of the query back to the browser, only the first item is displayed (making the JSON invalid):</p>

<pre><code>{
"id":
    {
        "timestamp":1540553241,
        "machine":3884863,
        "pid":-2023,
        "increment":3833504,
        "creationTime":"2018-10-26T11:27:21Z"
    },
    "building_Number":12345,
    "extraElements":
        [
            {
                "name":"Element01",
                "value":
                    {
                        "bsonType":2,
                        "rawValue":"I",
                        "value":"I"
</code></pre>

<p>I get a 404 returned by Postman, but I suspect this is due to the return being invalid.</p>

<p>I am at a loss to work out why these extra elements can be returned to the C# API correctly, but not returned to the caller from controller.</p>

<p>Any ideas?</p>

